import { Route as ReactDOMRoute } from "react-router-dom";

interface IRouteProps {
  isPrivate?: boolean;
  component: () => JSX.Element;
  path: string;
  exact?: boolean;
}

const Route = ({
  isPrivate = false,
  component: Component,
  ...rest
}: IRouteProps) => {
  return (
    <div>
      <Component />
    </div>
  );
};

export default Route;
